import React, { useState, useEffect } from 'react';
import { getTransactions } from '../../services/TransactionService/transactionService';
import './TransactionHistory.css';

const TransactionHistory = () => {
  const [transactions, setTransactions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [filter, setFilter] = useState({
    startDate: '',
    endDate: '',
    minAmount: '',
    maxAmount: '',
    productType: ''
  });

  useEffect(() => {
    loadTransactions();
  }, []);

  const loadTransactions = async () => {
    try {
      setLoading(true);
      const data = await getTransactions();
      setTransactions(data);
      setError('');
    } catch (err) {
      setError('Failed to load transactions');
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    setFilter({ ...filter, [name]: value });
  };

  const applyFilters = () => {
    return transactions.filter(transaction => {
      const transactionDate = new Date(transaction.transaction_date);
      const startDate = filter.startDate ? new Date(filter.startDate) : null;
      const endDate = filter.endDate ? new Date(filter.endDate) : null;

      return (
        (!startDate || transactionDate >= startDate) &&
        (!endDate || transactionDate <= endDate) &&
        (!filter.minAmount || transaction.total_amount >= parseFloat(filter.minAmount)) &&
        (!filter.maxAmount || transaction.total_amount <= parseFloat(filter.maxAmount)) &&
        (!filter.productType || transaction.items.some(item => item.product_type === filter.productType))
      );
    });
  };

  const filteredTransactions = applyFilters();

  return (
    <div className="transaction-history-page">
      <div className="page-header">
        <h1>Transaction History</h1>
        <p className="page-description">
          View and filter your transaction history with detailed tax information.
        </p>
      </div>

      <div className="calculator-form">
        <div className="form-section">
          <h2>Filter Transactions</h2>
          {error && <div className="alert alert-danger">{error}</div>}

          <form>
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="startDate">Start Date</label>
                <input
                  type="date"
                  id="startDate"
                  name="startDate"
                  value={filter.startDate}
                  onChange={handleFilterChange}
                  className="form-control"
                />
              </div>

              <div className="form-group">
                <label htmlFor="endDate">End Date</label>
                <input
                  type="date"
                  id="endDate"
                  name="endDate"
                  value={filter.endDate}
                  onChange={handleFilterChange}
                  className="form-control"
                />
              </div>
            </div>

            <div className="form-row">
              <div className="form-group">
                <label htmlFor="minAmount">Min Amount ($)</label>
                <input
                  type="number"
                  id="minAmount"
                  name="minAmount"
                  value={filter.minAmount}
                  onChange={handleFilterChange}
                  min="0"
                  step="0.01"
                  className="form-control"
                />
              </div>

              <div className="form-group">
                <label htmlFor="maxAmount">Max Amount ($)</label>
                <input
                  type="number"
                  id="maxAmount"
                  name="maxAmount"
                  value={filter.maxAmount}
                  onChange={handleFilterChange}
                  min="0"
                  step="0.01"
                  className="form-control"
                />
              </div>
            </div>

            <div className="form-row">
              <div className="form-group">
                <label htmlFor="productType">Product Type</label>
                <select
                  id="productType"
                  name="productType"
                  value={filter.productType}
                  onChange={handleFilterChange}
                  className="form-control"
                >
                  <option value="">All Types</option>
                  <option value="Physical Good">Physical Good</option>
                  <option value="Digital Software">Digital Software</option>
                  <option value="E-book">E-book</option>
                  <option value="Digital Media">Digital Media</option>
                  <option value="Service">Service</option>
                </select>
              </div>
            </div>

            <div className="action-buttons">
              <button 
                type="button" 
                className="btn btn-secondary "
                onClick={() => setFilter({
                  startDate: '',
                  endDate: '',
                  minAmount: '',
                  maxAmount: '',
                  productType: ''
                })}
              >
                Clear Filters
              </button>
            </div>
          </form>
        </div>
      </div>

      <div className="results-section">
        <h2 className="results-header">Transaction Records</h2>

        {loading ? (
          <p>Loading transactions...</p>
        ) : filteredTransactions.length === 0 ? (
          <p>No transactions found.</p>
        ) : (
          <table className="results-table">
            <thead>
              <tr>
                <th>Transaction ID</th>
                <th>Date</th>
                <th>Customer</th>
                <th>Items</th>
                <th>Subtotal</th>
                <th>Tax</th>
                <th>Total</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {filteredTransactions.map((transaction) => (
                <tr key={transaction.id}>
                  <td>{transaction.id}</td>
                  <td>{new Date(transaction.transaction_date).toLocaleDateString()}</td>
                  <td>{transaction.customer_name}</td>
                  <td>{transaction.items.length}</td>
                  <td>${transaction.subtotal.toFixed(2)}</td>
                  <td>${transaction.tax_amount.toFixed(2)}</td>
                  <td>${transaction.total_amount.toFixed(2)}</td>
                  <td>
                    <div className="btn-group">
                      <button 
                        className="btn btn-view btn-sm" 
                        onClick={() => alert(`View details for transaction ${transaction.id}`)}
                      >
                        View
                      </button>
                      <button 
                        className="btn btn-danger btn-sm" 
                        onClick={() => alert(`Delete transaction ${transaction.id}`)}
                      >
                        Delete
                      </button>
                    </div>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
};

export default TransactionHistory;
